Nosso destino da semana é um desses lugares que não decepciona. Quem gosta de praia, vida noturna e entretenimento, com certeza Los Angeles é o seu destino. Depois das aulas na @americanenglishcollege e aos finais de semana, não faltarão oportunidades pra aproveitar e viver o California Dreaming. Conheça nosso top 5 lugares imperdíveis na cidade do cinema:

5️⃣ Região de Santa Mônica: Você não pode deixar de curtir esse pier com um lindo pôr-do-sol na praia, com ótimos restaurantes e shoppings ao ar livre. Não pode esquecer do parque de diversões estilo retrô que é bem famoso.

4️⃣Caminhar pela calçada da fama: apesar de ser uma missão andar pela calçada da fama por conta da quantidade de pessoas que a visitam, pra quem vai pela primeira vez é bom dar uma passada por lá e garantir o click na estrela do seu ídolo.

🥉Curtir um concerto no Hollywood Bowl: Um dos programas preferidos dos angelinos é curtir as tardes de música ao ar livre do Hollywood Bowl onde rolam muitos concertos e shows importantes.

🥈Ver a Cidade do Alto do Griffith Observatory: a vista de LA de cima é de tirar o fôlego, especialmente no pôr-do-sol. Você consegue tirar a foto do Hollywood Sign de outro ângulo.

